export const daysLong = [{dayShort: 'Mon', dayLong: 'Monday'}, {dayShort: 'Tue', dayLong: 'Tuesday'},
    {dayShort: 'Wed', dayLong: 'Wednesday'}, {dayShort: 'Thu', dayLong: 'Thursday'},
    {dayShort: 'Fri', dayLong: 'Friday'}, {dayShort: 'Sat', dayLong: 'Saturday'},
    {dayShort: 'Sun', dayLong: 'Sunday'}];
